import styled from "styled-components";


export const Img = styled.img`
    
    width:180px;
    height: 180px;
    display: flex;
    margin:150px auto;
 
`;

export const Div = styled.div`
width:100%;
height:100%;
`
export const Div2 = styled.div`
display:flex;
gap:10px;
margin-right:10px;

`;


export const Div3 =styled.div`
position: absolute;
left: 8.1%;
right: 35.9%;
top: 70.85%;

`;


export const H1 = styled.h1`
position: absolute;


bottom: 25.71%;

font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 24px;
line-height: 29px;
/* identical to box height */

text-align: center;
letter-spacing: -0.3px;

/* Dark color */

color: #4B4B4B;
`;


export const P = styled.p`
position: absolute;
top:250px;

bottom: 20.97%;

font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 14px;
line-height: 17px;
letter-spacing: -0.3px;

/* Dark color */

color: #4B4B4B;
`;
